import React, { Component } from 'react';
import './App.css';
import Navigation from './components/Navigation';
import Particles from "react-particles-js";
import Logo from './components/Logo';
import ImgLinkForm from './components/ImgLinkForm';
import Rank from './components/Rank';
//const Clarifai = require('clarifai');
import Clarifai from 'clarifai';

const app = new Clarifai.App({
  apikey: '09f7fc57537a44df828b43038f1c4e57',
});

const param = {
  number: {
    value: 10,
    density: {
      enable: true,
      value_area: 1000
    }
  }
}

class App extends Component {
  constructor() {
    super();
    this.state = {
      ImgURL : "",
    }
  }

  onChangeURL = (event) => {
  //  console.log(event.target.value);
    this.setState({ ImgURL: event.target.value });
  //  console.log(this.state.ImgURL);
  }

  onSubmit = () => {
    console.log("click");
    // app.models.predict("a403429f2ddf4b49b307e318f00e528b", "https://samples.clarifai.com/face-det.jpg").then(
    //   function (response) {
    //     console.log(response);
    //     // do something with response
    //   },
    //   function (err) {
    //     // there was an error
    //   }
    // );

    app.models.predict(Clarifai.COLOR_MODEL,
    // URL
      "https://samples.clarifai.com/metro-north.jpg")
      .then(function(response) {
        // do something with responseconsole.log(response);

        },
        function(err) {// there was an error

        }
      );
  }

  render() {
    return (
      <div className="App">
        <Particles className='particles' params={param}/>
        <Navigation />
        <Logo/>
        <Rank/>
        <ImgLinkForm onChangeURL={this.onChangeURL} onSubmit={this.onSubmit}/>

      </div>
    );
  }
}

export default App;
